void heatCalc()//2ms
{
	if(syncCnt0 > 35 && JUDGE_State == ONLINE){fakeHeat0 = realHeat0;}
	else if(fakeHeat0 >= cooldown0/500)fakeHeat0 -= cooldown0/500;
	else fakeHeat0 = 0;
}

//时间中断入口函数
void HAL_TIM_PeriodElapsedCallback(TIM_HandleTypeDef *htim)
{
	if (htim->Instance == htim6.Instance)//2ms时钟`
	{
		HAL_NVIC_DisableIRQ(TIM6_DAC_IRQn);
		//imu解算
		mpu_get_data();
		imu_ahrs_update();
		imu_attitude_update();
		imu_temp_keep();
		if(imu.FirstEnter == 1) imu.InitCount++;
		if(imu.InitCount == 3000) {imu.InitFinish = 1;imu.FirstEnter = 0;imu.InitCount = 0;}
		//主循环在时间中断中启动
		controlLoop();
		Cap_Run();
		heatCalc();
		//自瞄数据解算（3ms）
		static int aim_cnt=0;
		aim_cnt++;
		if(aim_cnt==3)
		{
			EnemyINFOProcess();
			aim_cnt=0;
		}
		
		HAL_NVIC_EnableIRQ(TIM6_DAC_IRQn);
	}
	else if (htim->Instance == htim7.Instance)//1ms时钟
	{
		
		rc_cnt++;
		if(auto_counter > 0) auto_counter--;
		if(auto_counter_fps > 0) auto_counter_fps--;
		
		if (rx_free == 1 && tx_free == 1)
		{
			if( (rc_cnt <= 17) && (rc_first_frame == 1))
			{
				RemoteDataProcess(rc_data);				//遥控器数据解算
				HAL_UART_AbortReceive(&RC_UART);
				rx_free = 0;
				while(HAL_UART_Receive_DMA(&RC_UART, rc_data, 18)!= HAL_OK);
				if (counter == 10) 
				{
					tx_free = 0;
					Send_User_Data(); 
					counter = 0;
				}
				else counter++;				
					rc_cnt = 0;
			}
			else
			{
				if(rc_first_frame == 0) 
				{
				   WorkState = PREPARE_STATE;
				   HAL_UART_AbortReceive(&RC_UART);
				   while(HAL_UART_Receive_DMA(&RC_UART, rc_data, 18)!= HAL_OK);
  				 rc_cnt = 0;
				   rc_first_frame = 1;
				}
			}
			rc_update = 0;
		}
	}
	else if (htim->Instance == htim10.Instance)  //10ms，处理上位机数据，优先级不高
	{
		
		#ifdef DEBUG_MODE
		//zykProcessData();
		#endif
	}
}
